import React, { useState, useEffect, useCallback } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { bookingAPI, artworkAPI, getImageURL } from '../../services/api';
import './Booking.css';

function Booking() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [artwork, setArtwork] = useState(null);
  const [loading, setLoading] = useState(true);
  const [submitting, setSubmitting] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState(false);

  const [formData, setFormData] = useState({
    customer_name: '',
    email: '',
    phone: '',
    preferred_date: '',
    preferred_time: '',
    delivery_address: '',
    special_instructions: ''
  });

  const fetchArtwork = useCallback(async () => {
    try {
      setLoading(true);
      const response = await artworkAPI.getArtworkById(id);
      setArtwork(response.data.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching artwork:', error);
      setError('Failed to load artwork');
      setLoading(false);
    }
  }, [id]);

  useEffect(() => {
    fetchArtwork();
  }, [fetchArtwork]);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    setError('');

    try {
      const bookingData = {
        artwork_id: artwork.artwork_id,
        customer_name: formData.customer_name,
        email: formData.email,
        phone: formData.phone,
        preferred_date: formData.preferred_date,
        preferred_time: formData.preferred_time,
        delivery_address: formData.delivery_address,
        special_instructions: formData.special_instructions,
        total_amount: artwork.price
      };

      await bookingAPI.createBooking(bookingData);
      setSuccess(true);
      
      setTimeout(() => {
        navigate('/');
      }, 2000);

    } catch (err) {
      console.error('Booking error:', err);
      setError(err.response?.data?.message || 'Failed to submit booking. Please try again.');
      setSubmitting(false);
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading...</p>
      </div>
    );
  }

  if (!artwork) {
    return (
      <div className="error-container">
        <h2>Artwork not found</h2>
        <button onClick={() => navigate('/')}>Go Back Home</button>
      </div>
    );
  }

  if (success) {
    return (
      <div className="success-container">
        <div className="success-icon">✓</div>
        <h2>Booking Successful!</h2>
        <p>Your booking has been confirmed. We'll contact you shortly.</p>
        <p className="redirect-text">Redirecting to home...</p>
      </div>
    );
  }

  const today = new Date().toISOString().split('T')[0];

  return (
    <div className="booking-container">
      <button className="back-btn" onClick={() => navigate(-1)}>
        ← Back
      </button>

      <div className="booking-content">
        {/* Artwork Summary */}
        <div className="booking-summary">
          <h2>Booking Summary</h2>
          
          <div className="summary-artwork">
            <img 
              src={getImageURL(artwork.image_url)} 
              alt={artwork.title}
              onError={(e) => {
                e.target.src = 'https://via.placeholder.com/300x350?text=Image+Not+Found';
              }}
            />
            <div className="summary-info">
              <h3>{artwork.title}</h3>
              <p className="summary-artist">By {artwork.artist_name}</p>
              <p className="summary-category">{artwork.category}</p>
              <p className="summary-size">{artwork.wall_size}</p>
              <p className="summary-price">NPR {artwork.price.toLocaleString()}</p>
            </div>
          </div>
        </div>

        {/* Booking Form */}
        <div className="booking-form-section">
          <h2>Your Details</h2>
          
          {error && <div className="error-message">{error}</div>}

          <form onSubmit={handleSubmit} className="booking-form">
            <div className="form-group">
              <label>Full Name *</label>
              <input
                type="text"
                name="customer_name"
                value={formData.customer_name}
                onChange={handleChange}
                placeholder="Enter your full name"
                required
              />
            </div>

            <div className="form-group">
              <label>Email *</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="your.email@example.com"
                required
              />
            </div>

            <div className="form-group">
              <label>Phone Number *</label>
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
                placeholder="+977-9841234567"
                required
              />
            </div>

            <div className="form-row">
              <div className="form-group">
                <label>Preferred Date *</label>
                <input
                  type="date"
                  name="preferred_date"
                  value={formData.preferred_date}
                  onChange={handleChange}
                  min={today}
                  required
                />
              </div>

              <div className="form-group">
                <label>Preferred Time *</label>
                <input
                  type="time"
                  name="preferred_time"
                  value={formData.preferred_time}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <div className="form-group">
              <label>Delivery Address *</label>
              <textarea
                name="delivery_address"
                value={formData.delivery_address}
                onChange={handleChange}
                rows="3"
                placeholder="Enter your complete delivery address"
                required
              ></textarea>
            </div>

            <div className="form-group">
              <label>Special Instructions (Optional)</label>
              <textarea
                name="special_instructions"
                value={formData.special_instructions}
                onChange={handleChange}
                rows="4"
                placeholder="Any specific requirements or questions..."
              ></textarea>
            </div>

            <div className="form-actions">
              <button 
                type="button" 
                className="cancel-btn"
                onClick={() => navigate(-1)}
              >
                Cancel
              </button>
              <button 
                type="submit" 
                className="submit-btn"
                disabled={submitting}
              >
                {submitting ? 'Submitting...' : 'Confirm Booking'}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Booking;
